export const seedWorkspaces = async (
  workspaceDataSource: DataSource,
  schemaName: string,
  workspaceId: string,
) => {
  const workspaces: {
    [key: string]: Pick<
      Workspace,
      | 'id'
      | 'displayName'
      | 'domainName'
      | 'inviteHash'
      | 'logo'
      | 'subscriptionStatus'
    >;
  } = {
    [SeedAppleWorkspaceId]: {
      id: workspaceId,
      displayName: 'Apple',
      domainName: 'apple.dev',
      inviteHash: 'apple.dev-invite-hash',
      logo: 'data:image/png;base64,',
      subscriptionStatus: 'incomplete',
    },
    [SeedTwentyWorkspaceId]: {
      id: workspaceId,
      displayName: 'Twenty',
      domainName: 'twenty.dev',
      inviteHash: 'twenty.dev-invite-hash',
      logo: 'data:image/png;base64,',
      subscriptionStatus: 'incomplete',
    },
  };

  SeedWorkspaceIds.forEach((id) => {
    workspaces[id] = {
      id: workspaceId,
      displayName: 'Twenty',
      domainName: 'twenty.dev',
      inviteHash: 'twenty.dev-invite-hash',
      logo: 'data:image/png;base64,',
      subscriptionStatus: 'incomplete',
    };
  });

  await workspaceDataSource
    .createQueryBuilder()
    .insert()
    .into(`${schemaName}.${tableName}`, [
      'id',
      'displayName',
      'domainName',
      'inviteHash',
      'logo',
      'subscriptionStatus',
    ])
    .orIgnore()
    .values(workspaces[workspaceId])
    .execute();
};

export const deleteWorkspaces = async (
  workspaceDataSource: DataSource,
  schemaName: string,
  workspaceId: string,
) => {
  await workspaceDataSource
    .createQueryBuilder()
    .delete()
    .from(`${schemaName}.${tableName}`)
    .where(`${tableName}."id" = :id`, { id: workspaceId })
    .execute();
};
